{"operationName":"cart","variables":{},"query":"query cart {
  cart {
    ...orderFields
    __typename
  }
}

fragment orderFields on Order {
  orderItems {
    productId
    productDisplayName
    imageUrl
    quantity
    priceInfo {
      amount
      rawAmount
      __typename
    }
    __typename
  }
  totalQuantity
  totalAmount
  totalRawAmount
  existServices
  __typename
}
"}
